import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import MainContent from "./components/MainContent/MainContent";

class App extends React.Component {
  render() {
  return (
    <div className="App">
        <Header />
        <MainContent />   
    </div>
  );
}
}

export default App;
